/* src/components/layout/ModuleLayout/ModuleLayout.js */
import React, { useState } from 'react';
import DashBoard from '../../modules/DashBoard';
import EquipmentsPage from '../../modules/EquipmentsPage';
import TicketsPage from '../../modules/TicketsPage';
import './ModuleLayout.css';

function ModuleLayout({ selectedModule }) {
  if (selectedModule === 'dashboard') {
    return <Dashboard />;
  }
  if (selectedModule === 'equipments') {
    return <EquipmentsPage />;
  }
  if (selectedModule === 'tickets') {
    return <TicketsPage />;
  }

  return null; // Aucun module sélectionné
}

export default ModuleLayout;
